import React from "react";

const artistsToString = (artists) => {
  let return_string = '';
  let count = 0; 
  artists.forEach(element => {
    (count === 0) ? return_string += element.name + " " : return_string += element.name + ", ";
  });
  return return_string;
}

const Artist = (props) => {
  const artists = artistsToString(props.artists)
  return <p>{artists}</p>;
};

export default Artist;
